	_contact_number VARCHAR (20),
	_first_name VARCHAR (255),
	_middle_name VARCHAR (50),
	_last_name VARCHAR (255),
	_sex VARCHAR (25),
	_course VARCHAR (50),
	_year VARCHAR (25),
	_section VARCHAR (50),
