/*!50003 CREATE DEFINER=`system_admin`@`%` PROCEDURE `sp_registered_borrowers_get`(
	_type varchar (50)
)
BEGIN
	SELECT rb.id, rb.`first_name`,rb.`middle_name`,rb.`last_name`,CONCAT(rb.`last_name`, ", ",rb.`first_name`, " ", UPPER(SUBSTRING(rb.`middle_name`,1,1)),".") AS `name`,
	rb.`sex`,rb.contact_number, rb.`course`, CONCAT(rb.year," - ", rb.`section`) AS year_and_section, date_format(rb.`transdate`, "%M %d, %Y") as added_on, rb.section, rb.year,rb.image
